import React , {useState , useEffect} from 'react';
import axios from 'axios';
import '../App.css';
import Locations from './locations';
import Initialrestaurents from './initialrestaurents';

function Home() {
  let [location , setLocation] =  useState({
    lat : "17.4375084",
    long : "78.4482441"
  })

  return (
    <div className = "container-fluid">
    <div className='row'>
      <div className = "container-fluid">
      <div class = "row">
        <Locations 
        setLocations = {setLocation}/>
        <Initialrestaurents
            setLocations = {setLocation}
            location = {location}
        />
      </div>
      </div>
    </div>
  </div>
  )
}

export default Home
